css:
.undo-redo-toast {
  position: absolute;
  bottom: 10px;
  z-index: 100;
  width: 100%;
  text-align: center;
  pointer-events: none;
}
.undo-redo-toast .content {
  height: 45px;
  display: inline-block;
  padding-top: 12px;
  opacity: 0.9;
  border-radius: 3px;
  background: #292d32;
  white-space: nowrap;
  cursor: default;
  pointer-events: initial;
  display: inline-flex;
  flex-direction: row;
  max-width: 90%;
}
.undo-redo-toast .message {
  flex: 1;
  flex-shrink: 1;
  margin-left: 16px;
  margin-right: 30px;
  color: #ffffff;
  overflow: hidden;
  text-overflow: ellipsis;
  text-align: left;
}
.undo-redo-toast .action {
  flex-shrink: 0;
  margin-right: 15px;
  white-space: nowrap;
}
.undo-redo-toast .action img {
  background-color: #ffffff;
}
.undo-redo-toast .action .undo-action-text {
  margin-left: 5px;
  color: #ffffff;
}
body.platform-win32 .content {
  border-radius: 0;
}
.undo-redo-toast-fade-enter {
  opacity: 0.01;
  transform: translate3d(0, 10px, 0);
  transition: all 0.15s ease-out;
}
.undo-redo-toast-fade-enter.undo-redo-toast-fade-enter-active {
  opacity: 1;
  transform: translate3d(0, 0, 0);
}
.undo-redo-toast-fade-leave {
  opacity: 1;
  transform: translate3d(0, 0, 0);
  transition: all 0.15s ease-in;
}
.undo-redo-toast-fade-leave.undo-redo-toast-fade-leave-active {
  transform: translate3d(0, 10px, 0);
  opacity: 0.01;
}
